            <h3>{props.list.title}</h3>
        </div>
        <div className={styles.statsOptions}>
            <button className="more-options">â‹®</button>
        </div>
      <div className="stats-content">
        <h2>{props.list.value}</h2>
          {props.list.percentage > 0 ? '+' : ''}{props.list.percentage}%
      </div>
    </div>
  );
}

